// lib
import React from "react";
import { createUseStyles } from "react-jss";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import { useState, useEffect } from "react";

// Component
import Home from "../../home/Home";
import SignIn from "../signIn/SignIn";
import ResetPass from "../resetPass/ResetPass";

// =================================================================
const useStyles = createUseStyles({
  SignUp: {
    minHeight: "100vh",
  },
  signup__title: {
    fontSize: "5rem",
    marginBottom: "5rem",
  },
  signup__separate: {
    marginBottom: "2rem",
    fontSize: "1.5rem",
    color: "var(--text-color)",
  },
  signup__link: {
    display: "flex",
    alignItems: "center",
    gap: "0.5rem",
    marginTop: "2rem",
    color: "var(--text-color)",
    fontSize: "1.6rem",
  },
  signup__link__light: {
    color: "var(--text-color-light) !important",
  },
  signup__input: {
    fontSize: "1.6rem",
    marginBottom: "2rem",
  },
});

export default function SignUp() {
  const classes = useStyles();

  return (
    <div className={classes.signup}>
      <div className="content">
        <h1 className={classes.signup__title}>Sign In.</h1>

        <div className="buttons w-100">
          <button className="button btn--border btn--hover-border btn--full-width btn--flex  btn--hover-trans">
            <div className="button__icon">
              <ion-icon name="logo-google"></ion-icon>
            </div>
            <div className="button__text">Continue with Google</div>
          </button>
          <button className="button btn--border btn--hover-border btn--full-width btn--flex  btn--hover-trans">
            <div className="button__icon">
              <ion-icon name="logo-facebook"></ion-icon>
            </div>
            <div className="button__text">Continue with Facebook</div>
          </button>
        </div>

        <div className={classes.signup__separate}>or</div>

        <div className="inputs w-100">
          <input
            type="email"
            placeholder="Email"
            className={
              classes.signup__input + " input--border input--focus-border btn--full-width"
            }
          />
          <input
            type="password"
            placeholder="Password"
            className={
              classes.signup__input + " input--border input--focus-border btn--full-width"
            }
          />
        </div>

        <button className="button btn--bg-pink btn--bb-pink btn--none-border w-100">
          <span className="button__text">Sign Up</span>
        </button>

        <div className={classes.signup__link}>
          <span>Don't have an account?</span>
          <Link to="/users/signUp" className={classes.signup__link__light}>
            Sign up
          </Link>
        </div>

        <Link
          to="/users/resetPass"
          className={classes.signup__link + " " + classes.signup__link__light}
        >
          Forgot password?
        </Link>

        <Link to="/" className={classes.signup__link}>
          <ion-icon name="arrow-back-outline"></ion-icon>
          <div>Back to Home</div>
        </Link>
      </div>
    </div>
  );
}
